                                        refIdL4: refBC.ID,
                                        refNameL3: refBCL3 ? refBCL3.fullName : '',
                                        refIdL3: refBCL3 ? refBCL3.ID : '',
                                        refNameL2: refBCL2 ? refBCL2.fullName : '',
                                        refIdL2: refBCL2 ? refBCL2.ID : '',
